import React from "react";
import { useHistory } from "react-router-dom";
import { Flex, Dropdown, TextField, Button, Table } from "monday-ui-react-core";
import "../App.css";

const OrdersBoard = () => {
    const history = useHistory();
    const homepage = () => (
        history.push("/")
    )

    const columns = [{
        id: "item",
        title: "Item",
        width: 180,
        loadingStateType: "medium-text"
      }, {
        id: "salesAssociate",
        title: "Sales Associate",
        width: 200,
        loadingStateType: "long-text"
      }, {
        id: "scentProfiles",
        title: "Scent Profiles",
        width: 200,
        loadingStateType: "medium-text"
      }];

    return (
        <>
            <div className="App">
                <Button className="Back" onClick={homepage}>
                    Back to Home
                </Button>
                <Table style={{
                    width: "auto"
                }} size={Table.sizes.MEDIUM} columns={columns}>

                </Table>
            </div>
        </>
    );
};

export default OrdersBoard;
